import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import HomeScreen from './HomeScreen' ;

function App() {
  return (
    <BrowserRouter>
      <div>
      <header>
        <a href="/">Bemazone</a>
      </header>
      <main>
      <Routes>
        <Route path="/" element={<HomeScreen/>} />
      </Routes>
      </main>
    </div>
    </BrowserRouter>
  );
}

export default App;
